import { useEffect,useState } from "react";

const PostPage = () => {
    const {id}=useParams();
    const [postInfo,setPostinfo]=useState(null);
    useEffect(()=>{
        fetch(`http://localhost:4000/post/${id}`).then(response=>{
            response.json().then(postInfo=>{
                setPostinfo(postInfo)
            })
        })
    },[])
    if(!postInfo){
        return
    }
